import NavigationItems from '../Navigation/NavigationItems/NavigationItems'

const welcomePage = (props) => (
  <Aux>
    <div className={classes.Logo}>
      <WelcomeLogo></WelcomeLogo>
    </div>
    <div>
      // <NavigationItems></NavigationItems>
    </div>
  </Aux>
);

export default welcomePage;
